import './Carousels.css';
function Carousels({images}){
    return (
        <>
            <div className="carousels__card">
                <div className='carousels__left-arrow'></div>
                <div className='carousels__image'>
                    <img src="images" alt="logo" />
                </div>
                <div className='carousels__right-arrow'></div>
            </div>
        </>
    )
}
export default Carousels;
